    super();
    this.state={
      post:''
    }
  }

   handleChange = (e) => {
    
  }
  
  handleSubmit = (e) => {
    e.preventDefault();
  }
  

  render() {

    return (
     <div>
      <div className='row'>
        <div class="col s6 offset-s6">
        <div className='post'>
        <p>AJ</p>
        <div>
        <form onSubmit={this.handleSubmit} className='white'>
          <div className='input-field'>
            <label htmlFor='title'>Post here</label>
            <input type='text' id='title' onChange={this.handleChange} />
          </div>
          <div className='input-field'>
            <button className='btn pink lighten-1 z-dpth-0'>POST</button>
          </div>
        </form>
      </div>
        </div>
        </div>
        <div className='col s12 m3'>
        <br /><br /><br /><br /><br />
        <Follow />
        </div>
      </div>
      <div className='row'>
        <div className='col s12 m5'>
        <Followedpost />
        </div></div>
     </div>

    );
  }
}

export default Newsfeed;
